export default function Footer() {
  return (
    <PageWrapper>
      <div className="footerMain">
        <div>Copyright Â© 2022. All rights reserved.</div>
      </div>
    </PageWrapper>
  );
}

const PageWrapper = styled.footer`
  .footerMain {
    display: flex;
    align-items: center !important;
    vertical-align: bottom;
